import React from 'react';
import './Footer.css'

export default function Footer(props) {

    window.open('https://example.com', '_blank');


    return (
        <footer className='footer'>
            <div className='footer_block'>
                <p className='footer_block_text'>Учебный проект Яндекс.Практикум х BeatFilm.</p>
            </div>
            <div className='footer_note'>
                <p className='footer_note_year'>@2024</p>
                <div className='footer_note_block'>
                    <a href='https://practicum.yandex.ru/' className='footer_note_yandex'>Яндекс.Практикум</a>
                    <a href='https://github.com/Rafael99Gantus' className='footer_note_git'>Github</a>
                </div>
            </div>
        </footer>
    )
}
